import React,{Component} from 'react';

class Search extends Component {
	render(){
		return(<div>
			<h1>Les questions les plus posées sur le Covoiturage?</h1>
			<h3>Définition</h3>
			<p>Nous proposons de mettre en contact conducteurs et passagers pour partager un véhicule le temps d'un voyage déterminé. Le covoiturage peut s'effectuer entre le domicile et le lieu de travail (périphérie/centre ville par exemple) ou d'une ville à l'autre. Il s'adresse à tous les automobilistes qui souhaitent rouler autrement.</p>
			</div>
			);
	}
}
